var gulp            = require('gulp');
var watchify        = require('watchify');
var browserify      = require('browserify');

var uglify          = require('gulp-uglify');
var source          = require('vinyl-source-stream');
var buffer          = require('vinyl-buffer');
var gutil           = require('gulp-util');
var sourcemaps      = require('gulp-sourcemaps');

var browserSync     = require('browser-sync');
var reload          = browserSync.reload;

var browserifyOptions = {
    entries: ['./src/js/aos.js'],
    standalone: 'AOS',
    debug: true
};

var bundle = watchify(browserify(browserifyOptions))
                .on('update', makeBundle)
                .on('log', gutil.log);

function makeBundle() {
    return bundle.bundle()
        .on('error', gutil.log.bind(gutil, 'Browserify Error'))
        .pipe(source('aos.js'))
        .pipe(buffer())
        .pipe(sourcemaps.init({
            loadMaps: true
        }))
        .pipe(uglify({
            preserveComments: 'some'
        }))
        .pipe(sourcemaps.write('./'))
        .pipe(gulp.dest('./dist'))
        .pipe(reload({
            stream: true
        }));
}

module.exports = makeBundle;

var gulp            = require('gulp');

var sass            = require('gulp-sass');
var autoprefixer    = require('gulp-autoprefixer');
var concat          = require('gulp-concat');
var minifyCss       = require('gulp-minify-css');

var browserSync     = require('browser-sync');
var reload          = browserSync.reload;

module.exports = function() {
  gulp.src('src/sass/*.scss')
        .pipe(concat('aos.scss'))
        .pipe(sass({
            errLogToConsole: true
        }))
        .pipe(autoprefixer({
            browsers: ['> 1%']
        }))
        .pipe(minifyCss())
        .pipe(gulp.dest('dist'))
        .pipe(reload({
            stream: true
        }));
}

var gulp            = require('gulp');
var karma           = require('karma').Server;

var isTravis        = process.env.TRAVIS || false;
var pathToKarmaConf = __dirname.replace('/gulp', '').replace('\gulp', '');

module.exports = function(done) {
    new karma({
        configFile: pathToKarmaConf + '/karma.conf.js',
        singleRun: isTravis
    }, done).start();
};

